<script>
document.addEventListener('DOMContentLoaded', function() {
    var controlContainer = document.querySelector('.leaflet-control-layers-list');
    var inputs = controlContainer.querySelectorAll('input[type="checkbox"]');

    function updateMarkers() {
        var checkedCount = 0;
        inputs.forEach(function(input) {
            if (input.checked) {
                checkedCount++;
            }
        });



    updateMarkers();
});
</script>

<script>
// Función para posicionar el cuadro de imágenes debajo del selector de categorías
function positionLogoContainer() {
    // Selecciona el contenedor del selector de categorías
    var categoryControl = document.querySelector('.leaflet-control-layers'); // Ajusta el selector según sea necesario
    var logoContainer = document.getElementById('logo-container');
    
    if (categoryControl && logoContainer) {
        var rect = categoryControl.getBoundingClientRect();
        // Posiciona el cuadro de imágenes debajo del selector
        logoContainer.style.top = (rect.bottom + window.scrollY + 5) + 'px';
        logoContainer.style.right = (13) + 'px';
    }
}

// Llama a la función al cargar la página y al redimensionar la ventana
window.onload = positionLogoContainer;
window.onresize = positionLogoContainer;
</script>
